import "./App.css"

import { BrowserRouter } from "react-router-dom"
import Router from "./Routers"
import AuthProvider from "./contexts/AuthContext";

function App() {
  return (
    <AuthProvider>
      <BrowserRouter>
        <div className="App">
          <Router />
        </div>
      </BrowserRouter>
    </AuthProvider>
  );
}

export default App
